import React from "react";
import ReactDOM from "react-dom";
import { Provider } from 'react-redux';
import "./index.css";
import App from "./components/App";

const wrapper = (
  <Provider>
    <App />
  </Provider>
)

ReactDOM.render(<App />, document.getElementById("sudoku"));
